const Customer = (props) => {
  const {image, name, birthday, gender, job} = props;

  return (
    <div>
      <img src={image} alt="" />
      <strong>{name}</strong>
      <span>{birthday}</span>
      <span>{gender}</span>
      <span>{job}</span>
    </div>
  );
}

export default Customer;
